  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0117695 includes Surface
  underway, chemical and physical data collected from AIRCRAFT in the Arctic Ocean
  from 2005-05-02 to 2009-05-18 and retrieved during cruise ZZIC20050502. These data
  include AMMONIUM (NH4), CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113),
  CHLOROFLUOROCARBON-12 (CFC-12), DELTA HELIUM-3, DISSOLVED OXYGEN, Delta Oxygen-18,
  HELIUM, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature
  (theta), SALINITY, SILICATE, SULFUR HEXAFLUORIDE (SF6), Tritium (Hydrogen isotope)
  and WATER TEMPERATURE. The instruments used to collect these data include CTD, Carbon
  dioxide (CO2) gas analyzer, Shower head chamber equilibrator for autonomous carbon
  dioxide (CO2) measurement and bottle. These data were collected by James Swift of
  Scripps Institution of Oceanography and Peter Schlosser of Unknown as part of the
  SWITCHYARD_ZZIC2005SWYD data set.nnThe International CLIVAR Global Ocean Carbon
  and Repeat Hydrography Program carries out a systematic and global re-occupation
  of select WOCE/JGOFS hydrographic sections to quantify changes in storage and transport
  of heat, fresh water, carbon dioxide (CO2), and related parameters.\",\n\t\"owner_org\":
